import React from "react";

export default function PizzaPage() {
  const { id } = React.useParams();
  return (
    <div className="container">
      <img src={item.imageUrl} />
      <h2>
        {id} || {item.title}
      </h2>
      <p>Стоимость: {item.price}</p>
    </div>
  );
}
